INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24001, 10046, 2, 401, 24, 2, 0.0, 0.0, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "アヤネ", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24002, 10046, 2, 402, 24, 1, 0.0, 0.0, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "アヤネ", 2.21);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24003, 10046, 2, 403, 24, 2, 0.0, 0.0, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "アヤネ", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24004, 10046, 1, 701, 24, 2, 0.0, 0.0, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "アサヒ", 1.99);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24005, 10046, 2, 702, 24, 1, 0.0, 0.0, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "アサヒ", 2.21);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24006, 10046, 1, 703, 24, 2, 0.0, 0.0, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "アサヒ", 3.33);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24007, 10046, 2, 801, 24, 2, 0.0, 0.0, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "部員３", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24008, 10046, 2, 802, 24, 1, 0.0, 0.0, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "部員３", 2.68);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24009, 10046, 2, 803, 24, 2, 0.0, 0.0, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "部員３", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24010, 10046, 1, 501, 24, 1, 0.0, 0.0, 192501, "やった！", "", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24011, 10046, 1, 502, 24, 1, 0.0, 0.0, 192501, "勝ったよ！", "", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24012, 10046, 1, 503, 24, 1, 0.0, 0.0, 192501, "いい調子！", "", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24013, 10046, 2, 111, 24, 6, 0.0, 0.0, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "ミサト", 5.33);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24014, 10046, 2, 112, 24, 1, 0.0, 0.0, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "ミサト", 6.85);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24015, 10046, 2, 113, 24, 1, 0.0, 0.0, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "ミサト", 3.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24016, 10046, 2, 611, 24, 1, 0.0, 0.0, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "ダイチ", 6.11);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24017, 10046, 2, 612, 24, 1, 0.0, 0.0, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "ダイチ", 6.75);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24018, 10046, 2, 613, 24, 2, 0.0, 0.0, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "ダイチ", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24019, 10046, 1, 211, 24, 2, 0.0, 0.0, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "ハツネ", 4.52);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24020, 10046, 1, 212, 24, 2, 0.0, 0.0, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "ハツネ", 3.89);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24021, 10046, 2, 213, 24, 1, 0.0, 0.0, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "ハツネ", 13.49);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24022, 10046, 2, 311, 24, 1, 0.0, 0.0, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "カヤ", 3.17);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24023, 10046, 2, 312, 24, 1, 0.0, 0.0, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "カヤ", 4.42);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24024, 10046, 1, 313, 24, 6, 0.0, 0.0, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "カヤ", 2.89);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24025, 10046, 3, 421, 24, 4, 0.0, 0.0, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "アヤネ", 3.71);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24026, 10046, 1, 721, 24, 2, 0.0, 0.0, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "アサヒ", 5.1);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24027, 10046, 3, 821, 24, 1, 0.0, 0.0, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "部員３", 4.34);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24028, 10046, 1, 521, 24, 1, 0.0, 0.0, 192501, "いい勝負だったよ\nまたやろうね", "", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24029, 10046, 2, 101, 24, 1, 0.0, -360.0, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "ミサト", 5.62);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24030, 10046, 2, 102, 24, 1, 0.0, -360.0, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "ミサト", 9.58);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24031, 10046, 2, 103, 24, 2, 0.0, -360.0, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "ミサト", 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24032, 10046, 1, 104, 24, 2, 0.0, -360.0, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "ミサト", 9.13);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES ("2020/07/31 12:00:00", "2030/12/17 14:59:59", 24033, 10046, 2, 105, 24, 1, 0.0, -360.0, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "ミサト", 8.27);
